import React from "react";
import { redirect } from "react-router-dom";
import { Link } from "react-router-dom";
const Home = () => {
  return (
    <div>
      <nav>
        <h1>E commerce</h1>

        <Link to="/newProduct">
          <button onClick={redirect}>Upload Product</button>
        </Link>
      </nav>
    </div>
  );
};

export default Home;
